import 'date-fns';
import React from 'react';
import { useStyles } from './styles';
import CssBaseline from '@material-ui/core/CssBaseline';
import Container from '@material-ui/core/Container';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import DateFnsUtils from '@date-io/date-fns';
import Divider from '@material-ui/core/Divider';
import {
    MuiPickersUtilsProvider,
    KeyboardDatePicker,
} from '@material-ui/pickers';


const Entregas = () => {

    const classes = useStyles();
    const fecha_Defaul = new Date('2020-01-01T21:11:54');
    const [entrega1, setEntrega1] = React.useState(fecha_Defaul);
    const [entrega2, setEntrega2] = React.useState(fecha_Defaul);
    const [entrega3, setEntrega3] = React.useState(fecha_Defaul);




    return (
        <div>

            <div className={classes.root}>
                <React.Fragment>
                    <CssBaseline />
                    <Container maxWidth="sm">

                        <Grid container spacing={3}>
                            <Grid item xs>
                                <Paper className={classes.paper}>
                                    <MuiPickersUtilsProvider utils={DateFnsUtils}>
                                        <Grid container justify="space-around">
                                            <KeyboardDatePicker
                                                margin="normal"
                                                id="date-picker-dialog"
                                                label="Primera entrega"
                                                format="MM/dd/yyyy"
                                                value={entrega1}
                                                onChange={date => setEntrega1(date)}
                                                KeyboardButtonProps={{
                                                    'aria-label': 'change date',
                                                }}
                                            />
                                        </Grid>
                                    </MuiPickersUtilsProvider>
                                </Paper>
                            </Grid>
                            <Grid item xs>
                                <Paper className={classes.paper}>
                                    <MuiPickersUtilsProvider utils={DateFnsUtils}>
                                        <Grid container justify="space-around">
                                            <KeyboardDatePicker
                                                margin="normal"
                                                id="date-picker-dialog"
                                                label="Primera entrega"
                                                format="MM/dd/yyyy"
                                                value={entrega2}
                                                onChange={date => setEntrega2(date)}
                                                KeyboardButtonProps={{
                                                    'aria-label': 'change date',
                                                }}
                                            />
                                        </Grid>
                                    </MuiPickersUtilsProvider>
                                </Paper>
                            </Grid>
                            <Grid item xs>
                                <Paper className={classes.paper}>
                                    <MuiPickersUtilsProvider utils={DateFnsUtils}>
                                        <Grid container justify="space-around">
                                            <KeyboardDatePicker
                                                margin="normal"
                                                id="date-picker-dialog"
                                                label="Primera entrega"
                                                format="MM/dd/yyyy"
                                                value={entrega3}
                                                onChange={date => setEntrega3(date)}
                                                KeyboardButtonProps={{
                                                    'aria-label': 'change date',
                                                }}
                                            />
                                        </Grid>
                                    </MuiPickersUtilsProvider>
                                </Paper>

                            </Grid>
                            <Divider className={classes.divider}/>

                            <h1></h1>
                            <Grid item xs={8}>
                                <Paper className={classes.paper}>xs=8</Paper>
                            </Grid>
                            <Grid item xs={4}>
                                <Paper className={classes.paper}>xs=4</Paper>
                            </Grid>
                        </Grid>


                    </Container>
                </React.Fragment>
            </div>
        </div>
    );
}
export default Entregas
